				style={{ height: "150px", width: "150px" }}
				perspective={500}
				glareEnable={true}
				glareMaxOpacity={0.75}
				glarePosition="all"
				scale={1.02}
				trackOnWindow={true}
			>
				<h1>React Parallax Tilt ðŸ‘€</h1>
			</Tilt>
		</div>
	);
};

export default Logo;
